import { Button } from 'react-bootstrap';
import React from 'react';
import '../App.css';


export default function ItemCategoria({title,nameCategoria,cantidadProducto,clase}) {

  return (
   <Button  variant="outline-primary " title={title} className={clase}>
     <span className='textoBotn'>{nameCategoria}</span>
     <span className="position-absolute top-0 start-100 translate-middle badge rounded-pill bg-danger">{cantidadProducto}</span>
   </Button>
  )
}
